import { Component } from '@angular/core';
import { Medicine } from '../medicine';
import { MedicineService } from '../medicine.service';
import { Router } from '@angular/router';

@Component({
  selector: 'app-create-medicine',
  templateUrl: './create-medicine.component.html',
  styleUrls: ['./create-medicine.component.css']
})
export class CreateMedicineComponent {

  medicine : Medicine = new Medicine();  


  constructor(private medicineService:MedicineServiceprivate ,router:Router) { } 

  saveMedicine(){
    this.medicineService.creatMedicineService(this.medicine).subscribe(data=>{
      console.log(data);
    }); 
  }

  onSubmit(){
        this.saveMedicine();
        console.log(this.medicine);
  }

  goToViewMedicineList(){{
    this.router.navigate(['/medicinelist']);
  }
}
}
